import React from "react";
import {LogoImage, ScreenContainer} from "./styled";
import logo_transparante from "../../assets/logo_transparent.png";

const LoginPage = () => {
    return (
        <ScreenContainer>
          <LogoImage src={logo_transparante}/>
            <h1> LoginPage</h1>
        </ScreenContainer>
    )
}

export default LoginPage
